import React from 'react'
import styles from './PlanPage.module.css'
const PlanPage = (props) => {
  
    return(
        <div className={styles.planPage}>
            <h1 className={styles.h1}>{props.header}</h1>
            <p>Спланируйсвой</p>
        </div>
        
    )
}

export default PlanPage
